import React, { Component } from "react";

// import axios from 'axios'
import axios from "axios";

function getApiData() {
  let x = "789";
  // Make a request for a user with a given ID
  let obj = {
    external_id: "postman",
  };
  axios
    .post("https://node-fake-api-server.herokuapp.com/", obj)
    .then(function (response) {
      // handle success
      console.log(response.data);
    })
    .catch(function (error) {
      // handle error
      console.log(error);
    });
}

export function Test2() {
  getApiData();
  return <h1>console.log("hello")</h1>;
}
